import React from 'react';
import PropTypes from 'prop-types';
import { Text, View, StyleSheet } from '@react-pdf/renderer';
import Title from './Title';

const styles = StyleSheet.create({
  container: {
    marginBottom: 16,
  },
  school: {
    fontSize: 10,
    fontWeight: 'bold',
  },
  degree: {
    fontSize: 10,
  },
  candidate: {
    fontSize: 10,
  },
  entry: {
    marginBottom: 10,
  },
});
const Eduction = ({education}) => (
  <View style={styles.container}>
    <Title>Utbildning</Title>
    {education.map((education, i) => (
      <View style={styles.entry}>
        <Text style={styles.school}>{education.school}</Text>
        <Text style={styles.degree}>{education.degree}</Text>
        <Text style={styles.candidate}>{education.start} - {education.end}</Text>
      </View>
    ))}
  </View>
)

Eduction.propTypes = {
  education: PropTypes.arrayOf(PropTypes.object),
  skills: PropTypes.arrayOf(PropTypes.object),
  experience: PropTypes.arrayOf(PropTypes.object)
};

Eduction.defaultProps = {
  education: [{
      school: 'Solbergagymnasiet',
      degree: 'Natur',
      start: 'Jan 2000',
      end: 'Dec 2005'
  },
  {
      school: 'Lunds tekniska unversitet',
      degree: 'Master Datateknik',
      start: 'Mars 2005',
      end: 'Sept 2011'
  }]
};

export default Eduction;
